import React from 'react';
import { briefcase, circlemenu, help, puzzle, shutdown, stateboard, support } from '../Assets/icons/Icons';

const Sidebar = () => {
  return (
    <div className='sidebar w-full lg:w-1/6'>
      <div className='mt-12 lg:ml-10'>
        <img src={briefcase} alt="briefcase" />
        <img src={stateboard} alt="stateboard" />
      </div>
      <div className='flex lg:flex-col mt-4 lg:mt-40 ml-6 content-center'>
        <button className='bg-white lg:w-full content-center rounded-l-lg lg:rounded-l-none flex items-center h-8'>
          <img className='ml-4' src={circlemenu} alt="circlemenu" />
          <p className="ml-2">Dashboard</p>
        </button>
      </div>

      <div className='flex lg:flex-col my-6 ml-6 content-center'>
        <button className='bg-black lg:w-full content-center rounded-l-lg lg:rounded-l-none flex items-center h-8'>
          <img className='ml-4' src={support} alt="circlemenu" />
          <p className="ml-2 text-white">Support</p>
        </button>
      </div>

      <div className='flex lg:flex-col my-6 ml-6 content-center'>
        <button className='bg-black lg:w-full content-center rounded-l-lg lg:rounded-l-none flex items-center h-8'>
          <img className='ml-4' src={puzzle} alt="circlemenu" />
          <p className="ml-2 text-white">Plugins</p>
        </button>
      </div>

      <div className='flex lg:flex-col my-6 ml-6 content-center'>
        <button className='bg-black lg:w-full content-center rounded-l-lg lg:rounded-l-none flex items-center h-8'>
          <img className='ml-4' src={help} alt="circlemenu" />
          <p className="ml-2 text-white">Help</p>
        </button>
      </div>

      <div className='flex lg:flex-col mt-52 ml-6 content-center'>
        <button className='bg-white lg:w-full content-center  flex items-center h-8'>
          <p className="ml-2 lg:ml-12 text-red-600">Logout</p>
          <img className='ml-4' src={shutdown} alt="circlemenu" />
        </button>
      </div>
    </div>
  );
}

export default Sidebar;
